import React from "react";
import GitHubIcon from "@mui/icons-material/GitHub";
import LinkedInIcon from "@mui/icons-material/LinkedIn";
import Col from "react-bootstrap/Col";

const ContactPro = () => {
  return (
    <div className="ContactPro mt-5">
      <div className="typewriter-container">
        <div className="typewriter">
          <h1 className="text-decoration-underline">Me contacter</h1>
        </div>
      </div>
      <Col className="text-center" sm={12}>
        <a href="https://github.com/LucasL72">
          <GitHubIcon sx={{ fontSize: 70 }} />
        </a>
        <a href="https://www.linkedin.com/in/lucas-ledoux-244b0a175/">
          <LinkedInIcon sx={{ fontSize: 70 }} />
        </a>
        <iframe
          src="https://www.facebook.com/plugins/page.php?href=https%3A%2F%2Fwww.facebook.com%2Ffacebook&tabs=timeline&width=340&height=500&small_header=false&adapt_container_width=true&hide_cover=false&show_facepile=true&appId"
          width="340"
          height="500"
          style="border:none;overflow:hidden"
          scrolling="no"
          frameborder="0"
          allowfullscreen="true"
          allow="autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share"
        ></iframe>
      </Col>
    </div>
  );
};

export default ContactPro;
